import nodemailer from "nodemailer";
import { redis } from "../../utils/upstashClient";
import OpenAI from "openai";

const client = new OpenAI({
  apiKey: process.env.OPENAI_API_KEY,
});

export default async function handler(req, res) {
  if (req.method !== "POST") {
    return res.status(405).json({ message: "Method Not Allowed" });
  }

  const { email, description } = req.body;
  if (!email || !description) {
    return res.status(400).json({ message: "Missing required fields" });
  }

  try {
    const caseNumber = await redis.incr("caseCounter");
    const newCase = {
      id: caseNumber.toString(),
      email,
      description,
      status: "Ny",
    };
    await redis.rpush("cases", JSON.stringify(newCase));

    const prompt = `
    Du er en autorisert elektriker. Gi trygge, konkrete råd basert på problemet:
    ${description}
    Gi en kort forklaring, sikkerhetsråd og om kunden bør kontakte elektriker.
    `;

    const response = await client.chat.completions.create({
      model: "gpt-4o-mini",
      messages: [
        { role: "system", content: "Du er en hjelpsom elektriker-assistent." },
        { role: "user", content: prompt },
      ],
      temperature: 0.4,
    });

    const aiAdvice = response.choices[0].message.content.replace(/\n/g, "<br>");

    const kontaktLink = `https://elraad.no/kontakt-oss?saknummer=${caseNumber}`;

    const htmlContent = `
<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8" />
  <style>
    body { font-family: Arial, sans-serif; background-color: #f9f9f9; margin: 0; padding: 0; }
    .container { max-width: 600px; margin: 20px auto; background: #fff; border-radius: 8px; overflow: hidden; box-shadow: 0 4px 8px rgba(0,0,0,0.05); }
    .header { background-color: #0070f3; padding: 20px; text-align: center; color: #fff; }
    .header img { width: 50px; height: auto; display: block; margin: 0 auto 10px; }
    .content { padding: 20px; }
    .case-number { font-size: 18px; font-weight: bold; color: #333; margin-bottom: 15px; }
    .ai-box { background: #f1f5f9; border-left: 4px solid #0070f3; padding: 15px; margin-bottom: 20px; font-size: 14px; line-height: 1.5; color: #333; }
    .cta-button { display: inline-block; background: #0070f3; color: #fff; text-decoration: none; font-weight: bold; padding: 14px 20px; border-radius: 6px; }
    .footer { text-align: center; font-size: 12px; color: #999; padding: 15px; border-top: 1px solid #eee; }
  </style>
</head>
<body>
  <div class="container">
    <div class="header">
      <img src="data:image/png;base64," alt="Elråd Logo" />
      <h2>Elråd - Din digitale elektroassistent</h2>
    </div>
    <div class="content">
      <p class="case-number">Saksnummer: <strong>{CASE_NUMBER}</strong></p>
      <p><strong>AI-råd:</strong></p>
      <div class="ai-box">
        {AI_ADVICE}
      </div>
      <p style="text-align:center;">
        <a href="{KONTAKT_LINK}" class="cta-button">Trenger du fortsatt hjelp? Få personlig veiledning fra en autorisert elektroinstallatør.</a>
      </p>
    </div>
    <div class="footer">
      &copy; 2025 Elråd. Alle rettigheter reservert.
    </div>
  </div>
</body>
</html>
`
      .replace("{CASE_NUMBER}", caseNumber)
      .replace("{AI_ADVICE}", aiAdvice)
      .replace("{KONTAKT_LINK}", kontaktLink);

    const transporter = nodemailer.createTransport({
      service: "gmail",
      auth: {
        user: process.env.EMAIL_USER,
        pass: process.env.EMAIL_PASS,
      },
    });

    await transporter.sendMail({
      from: `"Elråd" <${process.env.EMAIL_USER}>`,
      to: email,
      subject: `Bekreftelse - Sak ${caseNumber}`,
      html: htmlContent,
    });

    return res.status(200).json({ message: "E-post sendt", caseNumber });
  } catch (error) {
    console.error("Feil ved sending av e-post:", error);
    return res.status(500).json({ error: "Kunne ikke sende e-post" });
  }
}